description:
Hello,

&lt;s&gt;You are bidding on a set of brand new condition&lt;/s&gt; Storage Wars episodes 13-19 of season 1. :)

All episodes here were at first improperly named as &quot;S02&quot; by various release groups, you can see how exactly in each filename. And now that the real S02 comes out, it becomes difficult to locate these among the 'real' S02 EPs.

Also note that they were aired in an order not corresponding to the episode order that is now posted on the A&amp;E website (which adds to the mess).

So in this torrent they are collected together and renamed for correctness, according to:

 &lt;a href=&quot; https://secure.wikimedia.org/wikipedia/en/wiki/Storage_Wars&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; https://secure.wikimedia.org/wikipedia/en/wiki/Storage_Wars&lt;/a&gt;
 &lt;a href=&quot; http://www.aetv.com/storage-wars/episode-guide/season-1/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://www.aetv.com/storage-wars/episode-guide/season-1/&lt;/a&gt;

You can find previous episodes of Season 1 (1-12) at:

 &lt;a href=&quot; https://thepiratebay.se/torrent/6168353/Storage_Wars_Season_1_Complete&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; https://thepiratebay.se/torrent/6168353/Storage_Wars_Season_1_Complete&lt;/a&gt;

Enjoy! :)
